// import logo from './logo.svg';
import './App.css';
import Data from './components/Data';
import Navbar from './components/Navbar';
import {
  BrowserRouter as Router
} from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <Navbar />
        <Data />
      </Router>
    </div>
  );
}

export default App;
